var React = require('react');
var NavLink = require('react-router-dom').NavLink;



function Nav ()

{

    return (

        <ul className = 'Nav'>

            <li>

                <NavLink activeClassName = 'active' to = '/'>

                Home


                </NavLink>
            </li>
        </ul>
    )
}

export default Nav;
